import React from 'react';
import LoginPage from './LoginPage'
import MainWindow from './operationSystem/MainWindow'
import InputSelect from 'react-select-input';

function App() {
  return (
    <div className="App">
       {/* <MainWindow/> */}
      <InputSelect>
      <div className="selection">
        Selection label: <strong>{this.state.selected.label || "none"}</strong>, value: <strong>{this.state.selected.value || "none" }</strong>
      </div>
      </InputSelect>
       {/* <LoginPage/> */}
    </div>
  );
}

export default App;
